import React from 'react';

function About() {
  return(
    <section className="about-section section">
      <div className="container">
        <div className="row">
          <div className="section-title">
            <h2 data-heading="main info">About me</h2>
          </div>
        </div>
      </div>
    </section>
  );
}

export default About;
